import React, { Component } from "react";

class Rank extends Component {
    render() {
        return (
            <div className="fontIn">
                <div className="white f2">
                    {"Anik, your current rank is ..."}
                </div>
                <div className="white f1">
                    {"#3"}
                </div>
            </div>
        );
    }
}

export default Rank;
